SUV専用ミラー！このモデルは跳ね上がるように格納することが出来ます。SUV用に開発された広くて大きなミラーレンズは、後方の視界を最大限に確保することができます。<br><br>本体には安全性・視認性に優れた高輝度LEDウインカーを装備。もちろんミラー面も電動で動かすことが出来ます。(取付には配線の加工が必要になります。）<br><br>●カラー：マテリアルブラック　●格納式　●LEDウインカー　●ミラーレンズ電動調整式　●右ハンドル車用　※【注意】ミラー本体のサイズが大きいため、車によっては大きさのバランスが合わない場合があります。ご注意ください。（ミラー本体全長：約30cm）<br><br><br>適合車種：スイフトスポーツ ZC31S [2004～2010]<br><br>ボディパーツ | ドアミラー<br>スズキ | スイフト | ZC(ZD)11S/21S/31S/71S<tr><td colspan="2">
